import React, { Fragment } from 'react';
import './App.css';
import Box from '@material-ui/core/Box'


function Home() {
  return (
    <div 
      style={{
        backgroundColor: 'blue',
        height: '100px'
    }}
    >
      <Box component="span" color="orange" m={1}>
        <h1>Home cvPage</h1>
      </Box>
    </div>
    
  );
}

export default Home;
